def findemoji(r_input, b_input, g_input, r_most, g_most, b_most, r_avg, g_avg, b_avg):
    #this is the prosses peformed to convert the RGB color value for a pixel to is corasponding emoji
    #1: it retives and parses the most frequent and avrage red blue and green value for each emojis
    #2: it finds the diffrence bettween the current pixel and the most frequent color value for red blue and green
    #3: it avages all of those diffrences
    #4: it finds the lowest of the values and if there's is multible equal values it puts those in an array
    #5: if there is only one emoji in the array return that emoji if not go with the emoji has the closest avarge of the RGB color values to the input color
    #6: decode the emojis from bash 64 to UTF-8


    r_subtracted = {}
    g_subtracted = {}
    b_subtracted = {}


    #2: it finds the diffrence bettween the current pixel and the most frequent color value for red blue and green
    for emoji, value in r_most.items():
        r_subtracted[emoji] = abs(int(value) - r_input)

    for emoji, value in g_most.items():
        g_subtracted[emoji] = abs(int(value) - g_input)

    for emoji, value in b_most.items():
        b_subtracted[emoji] = abs(int(value) - b_input)

    avarge_subtracted = {}


    #3: it avages all of those diffrences
    for emoji, value in r_avg.items():
        avarge_subtracted[emoji] = r_subtracted[emoji] + b_subtracted[emoji] + g_subtracted[emoji] / 3

    closest_value = ""

    #4: it finds the lowest of the values and if there's is multible equal values it puts those in an array
    for emoji, value in avarge_subtracted.items():
        if closest_value == "": #if this is the first value
            closest_value = value
            closest_emoji = [emoji]
        #elif len(bytes(emoji, encoding='UTF-8', errors='replace').decode("UTF-8")) > 1:
        #    print("aa")
        elif value < closest_value:
            closest_value = value
            closest_emoji = [emoji]
        elif value == closest_value:
            closest_emoji.append(emoji)

    r_avg_subtracted = {}
    g_avg_subtracted = {}
    b_avg_subtracted = {}
    avg_subtracted = {}


    #5: if there is only one emoji in the array return that emoji if not go with the emoji has the closest avarge of the RGB color values to the input color
    if len(closest_emoji) > 1:
        for i in closest_emoji:
            r_avg_subtracted[i] = abs(float(r_avg[i]) - r_input)
            g_avg_subtracted[i] = abs(float(g_avg[i]) - g_input)
            b_avg_subtracted[i] = abs(float(b_avg[i]) - b_input)

        for i in closest_emoji:
            avg_subtracted[i] = r_avg_subtracted[i] + b_avg_subtracted[i] + g_avg_subtracted[i] / 3

            closest_value = ""

        for emoji, value in avg_subtracted.items():
            if closest_value == "": #if this is the first value
                closest_value = value
                closest_emoji = [emoji]
            elif value < closest_value:
                closest_value = value
                closest_emoji = [emoji]

    #6: decode the emojis from bash 64 to UTF-8
    #closest_emoji_decoded = []
    #for i in closest_emoji:
    #    if i == "8J+qw==": #edge case
    #        closest_emoji_decoded.append("\u200d")
    #    else:
    #        print
    #        closest_emoji_decoded.append(str(base64.b64decode(i), encoding='UTF-8'))
    #return str(closest_emoji_decoded)[2:-2]

    #uses unicodelookup it replaces the name of the emoji with that emoji in unicode also it degenderfise the emoji becuase discord doesn't have gendered emojis
    closest_emoji_decoded = []
    for i in closest_emoji:
        closest_emoji_decoded.append(i)

    if str(closest_emoji_decoded)[2:-2] == "Cra":
        return unicodedata.lookup("Footprints")

    if str(closest_emoji_decoded)[2:-2].startswith("Woman") or str(closest_emoji_decoded)[2:-2].startswith("Man"):
        return unicodedata.lookup(str(closest_emoji_decoded)[2:-2].replace("Woman ", "").replace("Man ", ""))
    else:
        return unicodedata.lookup(str(closest_emoji_decoded)[2:-2].replace("Woman", "Person").replace("Man", "Person"))

